```json
{
"application": "VASP",
"software": [
"intel/2019.1.144",
"openmpi/4.0.1"
],
"resources": [
{
"name": "nodes",
"value": 1
},
{
"name": "tasks",
"value": 16
},
{
"name": "cpus-per-task",
"value": 1
},
{
"name": "memory-per-cpu",
"value": "1000mb"
},
{
"name": "time",
"value": "6:00:00"
}
]
}
```

This script runs the Vienna Ab-initio Simulation Package (VASP) software. 

It utilizes the following software:
- Intel compiler version 2019.1.144
- OpenMPI version 4.0.1 

It requests the following resources:
- 1 node
- 16 tasks 
- 1 CPU per task
- 1000 MB of memory per CPU
- A maximum runtime of 6 hours.
